import React, { Component } from "react";
import { FaUserPlus } from "react-icons/fa";

export default class Register extends Component {
  constructor(props) {
    super(props)

    this.state = {
       username: '',
       password: '',
       confirmPass: ''
    }
  }

  handleSubmit = (e) => {
    e.preventDefault()
  }

  render() {
    return (
      <div style={{ width: "30rem" }} className="mx-auto">
        <form >

          <input
            className="form-control"
            type="text"
            placeholder="Username"
            required
            autoFocus
          />
          <input
            className="form-control"
            type="password"
            placeholder="Password"
            required
          />
          <input
            className="form-control"
            type="password"
            placeholder="Confirm Password"
            required
          />
          <button className="btn btn-primary btn-block mb-4 mt-3" type="submit"
            onSubmit = {this.handleSubmit}
          >
            <FaUserPlus /> Register
          </button>
        </form>
      </div>
    );
  }
}
